import React from 'react';
import BannerProcess from '../components/Banner/BannerProcess';


const DevOps = () => {
    return(
        <div className="body_wrapper">
            <BannerProcess 
                Pclass="devops_banner_area"
                P2class="s_round one"
                P3class="s_round two"
                Title="TitleDevOps" 
                TextD="TextDDevOps"
                img_process="img-devops-int.png"/>   
           

        </div>
    )
}
export default DevOps;
